window.bookSummaryJSON = "<p>Sistina awakened after millennia of dormancy, her memories in tatters and born anew. Residing in the ruins of an ancient city, she finds herself drawn into a war between two elven nations and the slaver kingdom of Kelvanis when she rescues a princess from slavery. </p> <p>With her domain containing hints of forgotten knowledge, Sistina becomes a dungeon, stronghold, and source of hope all at once. And perhaps, just perhaps, she could finally find love in her new life. </p> <p>This is a dark fantasy novel suitable for adults. </p>"; 
